import React from 'react';
import './PaymentPage.css'; // Import the CSS to apply the styles

const FawryPage = () => {
  return (
    <div className="payment-container">
      <h2>Fawry Payment</h2>
      <form className="payment-form">
        <input 
          type="text" 
          className="payment-input" 
          placeholder="Fawry Account Number" 
        />
        <input 
          type="text" 
          className="payment-input" 
          placeholder="Amount" 
        />
        <button type="submit" className="payment-submit-btn">Pay Now</button>
      </form>
    </div>
  );
};

export default FawryPage;
